import {createGlobalStyle} from "styled-components"
import FontName400 from "../assets/fonts/FontName400.woff2"

export const GlobalStyles = createGlobalStyle`
  @font-face {
    font-family: Font Name;
    font-style: normal;
    font-weight: 400;
    src: url(${FontName400});
  }
`
